import Card from 'react-bootstrap/Card';
import Col from 'react-bootstrap/Col';
import Row from 'react-bootstrap/Row';
import style from '../quiz/QuizDetails.module.css'

function CommentRatting() {
  return (
    <Row xs={2} className="g-4">
        <Col>
          <Card>
            <Card.Body>

              <p class="text-smallcta quiz-action p-1 leave-comment-btn mb-0"><img className={style.imageAdjust} src="https://seekify-public.s3.ap-south-1.amazonaws.com/resources/1674128731438-comments.png" alt="comments" />Leave a Comment </p>
              <p class="text-smallcta quiz-action p-1 save-quiz-btn mb-0 ">
                <img className={style.imageAdjust} src="https://seekify-public.s3.ap-south-1.amazonaws.com/resources/1674036291473-Vector.png" alt="save" /><span >Save Quiz</span>
              </p>
              <p class="text-smallcta quiz-action p-1 challenge-friend-btn mb-0"><img className={style.imageAdjust} src="https://seekify-public.s3.ap-south-1.amazonaws.com/resources/1674128368974-challengeafriend.png" alt="challenge" />Invite Friends</p>

            </Card.Body>
          </Card>
        </Col>

        <Col>
          <Card>
            <Card.Body>

            </Card.Body>
          </Card>
        </Col>
    </Row>
  );
}

export default CommentRatting;
